import React, { useEffect } from 'react';
import {useSelector, useDispatch} from 'react-redux';
import { getClubs } from "../../store/clubs";
import ClubsCard from '../ClubsCard';
import styles from '../ClubsPage/ClubsPage.module.css'
// import '../../../node_modules/font-awesome/css/font-awesome.min.css';


const ClubsPage = () => {
  const dispatch = useDispatch();

  useEffect(async() => {
    await dispatch(getClubs())
  }, [dispatch])

  const clubs = useSelector(state => Object.values(state.clubs))

  return (
    <>
    {/* <div className={styles.topBar} ></div> */}
    <div className={styles.clubsOuterDiv}>
      <div className={styles.clubsTopTwoLine}>
      <div className = {styles.clubTitle} >
          CLUBS AT YALE
      </div>
      <div className={styles.clubsMiddleContainer}>
        <button className={styles.startButton}>
            Start a club
        </button>
        <div className={styles.searchBarContainer}>
              {/* <i className ="fas fa-search"></i> */}
              <input placeholder="Search" className={styles.clubPageSearch} type='text' name='username' />
        </div>
      </div>
      </div>
      <div className = {styles.clubCardContainer} >
        {clubs.map((club) => (
          <ClubsCard club={club}/>
        ))}
      </div>
    </div>
    </>
  )
}

export default ClubsPage;
